import React, { Component } from 'react';

class TopNavRightIcon extends Component {
    
    render() {
        return (
       <ul class="list-inline2">
            <li>
                <div className='select '>
                    <a href="login.html" title="register" target="_blank">
                        <option>سجل هنا</option>
                    </a>
                    <a href="register.html" title="register" target="_blank">
                        <option>الاشتراك</option>
                    </a>
                </div>
                    <i class="fas fa-users"></i>
            </li>
                <li>
                    <a href="tel:01028496209" title="Call me" target="_blank" class="mobile">01028496209<i class="fas fa-phone-alt"></i></a>
                </li>
                <li>
                    <a href="mailto:info@yourdomain.com" title="Mail" target="_blank">info@yourdomain.com<i class="far fa-envelope"></i></a>
                </li>
        </ul>
    );
    }
};

export default TopNavRightIcon;
